(()=>{const s=document.getElementById("sidebar"),e=document.getElementById("content"),c=document.getElementById("collapse-menu");c.onclick=()=>{s.classList.contains("closed")?(s.classList.remove("closed"),e.classList.remove("col-10"),e.classList.add("col-9")):(s.classList.add("closed"),e.classList.remove("col-9"),e.classList.add("col-10"))}})();